import './App.css';
import React from 'react'

function Header(props) {
    return (
      <div>
        <h1>Full Stack Development Roadmap- {props.year}</h1>
      </div>
    )
}

function MainContent(props) {
  return (
      <div>
        <ul>
          <li>{props.courseName}</li>
        </ul>
      </div>
  )
}

function Footer(props) {
  return (
    <div>
      <p>&copy; Made with Love by- {props.author}</p>
    </div>
  )
}


function App() {
  return (
    <div className="App">
      <Header year="2022" />
      <MainContent courseName="Java" />
      <Footer author="Tarun Singh"/>
    </div>
  );
}

export default App;
